import React, { useEffect, useState } from "react";
const Vans = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function fetchData() {
      setLoading(true);
      try {
        const res = await fetch("/api/vans");
        const resdata = await res.json();
        setData(resdata);
        console.log(resdata);
      } catch (error) {
        console.log(error);
      } finally {
        setLoading(false);
      }
    }
    fetchData();
  }, []);

  if (loading) {
    return (
      <div className="">
        <div className="">loading</div>
      </div>
    );
  }
  const vansElement = data.map((item) => {
    const { title } = item;
    return (
      <div className="item">
        <div className="" key={item.id}>
          {title}
        </div>
      </div>
    );
  });
  return <div className="item_list">{vansElement}</div>;
};

export default Vans;
